import { useState } from "react";
import { useDispatch } from "react-redux";
import { api, database, fetchDogs } from "../../store/actions/actions";

export default function FilterDbApi() {
  let dispatch = useDispatch();

  const [color, setColor] = useState({
    active: "",
  });

  const handleClick = (fn, e) => {
    dispatch(fn());
    setColor({
      active: e.target.value,
    });
  };

  return (
    <div className="apidb">
      <button
        onClick={() => handleClick(fetchDogs)}
        className={(isActive) => "nav-link" + (!isActive ? " unselected" : "")}
      >
        All
      </button>
      <button onClick={(e) => handleClick(api, e)} className="button">
        Api
      </button>
      <button onClick={(e) => handleClick(database, e)} className="button">
        Database
      </button>
    </div>
  );
}
